import "./ExpenseItem";

function Expenses(props) {

    return (
        <div>
          <ExpenseItem
            title={props[0].title}
            amout={props[0].amount}
            date={props[0].date}
          />
          <ExpenseItem
            title={props[1].title}
            amout={props[1].amount}
            date={props[1].date}
          />
          <ExpenseItem
            title={props[2].title}
            amout={props[2].amount}
            date={props[2].date}
          />
          <ExpenseItem
            title={props[3].title}
            amout={props[3].amount}
            date={props[3].date}
          />
        </div>
      );
}

export default Expenses;
